%[text] %[text:anchor:T_9E0A9F30] # RGB images
%[text] In this module, we will learn about RGB images. An RGB image is an image that depicts color based on the additive color model of human color vision. In an RGB image, each color is produced by adding up the contributions of the Red, Green, and Blue channels
%[text] ![](text:image:892a)
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] %[text:anchor:H_B507FCED] ## Open an RGB image
%[text] Ok, so let's load and display an RGB image in MATLAB using **imtool.**  MATLAB provides several example images, one of which is called 'strawberries.jpg'. The function imageViewer knows about this image.
clearvars
imageViewer close % close all imageViewer windows
clc
%%
imageViewer('strawberries.jpg')
%[text] Explore the image using **imageViewer.** 
%[text] Under zoom, select "Zoom to Pixels"
%[text] - Notice that there are three values for each pixel location.  \
%[text] Review the Image Metadata
%[text] - **Colortype:** 'truecolor' \
%[text] Can you change the colormap? Or Adjust the contrast? Why not?
%[text] Export the image data to the workspace
%[text] ![](text:image:39f7)
%[text] - Call the variable 'RGB
%[text] - Inspect the variable in the workspace:
%[text] - Notice the third dimension \
%%
%[text] You can also load the variable directly into the workspace using `imread`.
RGB = imread("strawberries.jpg");
%%
%[text] %[text:anchor:H_A418C6F4] ## RGB representation
%[text] RGB images are represented on computers as three-dimensional arrays, where the planes are the channels. There is a red, a green, and a blue channel.  Think of something like this:
%[text] ![](text:image:1dde)
%[text] The RED channel is always the first plane and the BLUE channel is always the last plane. Use the mnemonic "RGB" to remember the order of the channels.
%[text] %[text:anchor:H_2CE75B10] ### RGB triplet
%[text] Each pixel in an RGB image contains 3 intensity values. These values are known as an RGB Triplet. Even though there are 3 intensity values, there is only one spatial location.
%[text] Indexing a triplet in MATLAB might look something like this, which reads as 1st row, 1st column, all planes.
%[text] ![](text:image:59e6)
%[text] 
%[text] We can explore RGB triplets in MATLAB using the function **uisetcolor**
rgb_triplet = uisetcolor
%[text] After running the above code:
%[text] - Click on different colors: note the changes in RGB values
%[text] - What are the RGB values for RED, GREEN, BLUE?
%[text] - What are the RGB values for gray colors?
%[text] - Toggle between \[0-1\], \[0-255\], and HEX.
%[text] - Note: HEX is Base-16, with values ranging from 0-9, A-F. The first two values represent the Red Channel, the second two values, Green, and the third values, Blue. You will often see HEX in image processing software (like Photoshop) or in [internet colors](http://www.color-hex.com) \
%[text] If you get stuck, be sure to click OK (or CANCEL) to continue
%%
%[text] %[text:anchor:H_1FBD7E10] ### Colormaps are also arrays of RGB triplets
%[text] In fact, MATLAB colormaps are simply an array RGB triplets. The columns of the colormap indicate the R, G, B values, in that order, and the rows map the intensity values. For example, in a 8-bit image, the first row of a colormap maps to an intensity of 0, while the last row maps to an intensity of 255.
%[text] For example, here is the **turbo** map with just 10 different colors mapped
turbo(10)
%[text] - **turbo** starts bluish (notice the high values in 3rd column for the first few rows).
%[text] - and then finishes up reddish (high values in the first column for the last few rows.  \
%%
%[text] To visualize a colormap, consider the vector `V` with 16 intensity values spaced from 0 to 255. 
%[text] We use the function **`heatmap`** to visualize the values in `V` by their corresponding colormap color (see color bar)
figure
tiledlayout(1,2,"TileSpacing","tight","Padding","compact")

V = uint8(linspace(0,255,16))'; % create a vector with evenly spaced numbers from 0-255
nexttile;
heatmap(V,'Colormap',turbo(10));
title('turbo')

nexttile;
heatmap(V,'Colormap',parula(10));
title('parula')
%[text] - The matrices are plotted as heat maps with their intensities listed in a given "pixel"
%[text] - The colormaps are visualized as the skinny colorbars sitting immediately to the right of the 4X5 matrices
%[text] - Notice how the matrices have 16 "intensity values" , but the colormaps have only 10 shades of color. So, there is some interpolation going on here \
%[text] **Now you try:**
%[text] 1. How would you change the code so that there were 25 numbers in `M`
%[text] 2. How would you change the code above so that there were 25 colors in each color map? \
%%
%[text] %[text:anchor:T_608CA992] # Load an RGB image into workspace
%[text] Now, let's load another RGB image into the MATLAB workspace and review its properties. 
clear
close all
mmSetUnitDataFolder(2) % change to Unit 2 data folder
RGB = imread('Dexia-Tower-Rogier-Plein-Brussels.jpg');
imshow(RGB)
impixelinfo
%[text] - The image variable is called RGB
%[text] - Scrub the mouse over the image. Notice that there are three pixel values at each location \
%%
%[text] %[text:anchor:H_E8159972] ### What are the image dimensions?
size(RGB) % all three dimensions
height(RGB) % number of rows
width(RGB) % number of columns
%[text] - notice that pesky third dimension \
%[text] %[text:anchor:H_D429D757] ### What is the image bit depth?
class(RGB)
%[text] %[text:anchor:H_169D40C4] ### What is the max pixel of the image?
max(RGB(:))
%%
%[text] %[text:anchor:T_DB11EBBE] # Indexing RGB channels
%[text] You can view RGB channels separately, one at time, by indexing them
%[text] Recall that: 
%[text] - Dimension 1 = rows
%[text] - Dimension 2 = columns \
%[text] For RGB images, 
%[text] - Dimension 3 = color channel (or plane) \
%[text] To index a channel from an image variable, you need to index in the the third dimension, which means that you need a third input inside the parentheses. So, indexing channels in MATLAB looks something like this...
%[text] ![](text:image:04ef)
%[text] 
%[text] ...Which basically reads as 'all rows, all columns, Plane 1'. Or 'all rows, all columns, Plane 2', etc. Remember, that Plane 1 = Red, 2 = Green, and 3 = Blue.
%[text] %[text:anchor:H_37F05275] ## Displaying a channel
%[text] Notice that a plane has the same dimensions as a grayscale image (*m* rows x *n* columns). So, we can display a channel as if it were a grayscale image.
%[text] The following code indexes the red channel and displays it as a grayscale image:
figure(WindowStyle="docked");
%%
clf % clear figure
tiledlayout(1,2,"TileSpacing","none","Padding","compact")

nexttile;
imshow(RGB);
title('RGB');

nexttile; 
ch = 2; % set channel %[control:spinner:575f]{"position":[6,7]}
imgpln = RGB(:,:,ch); % third input, 1st plane
imshow(imgpln); 
title(sprintf('Channel %d',ch))% display channel as a grayscale image
impixelinfo % add pixel info to figure
%[text] - Scrub around the RGB vs the RED Channel and compare the pixel intensities
%[text] - Notice that the bright pixels in the channel image correspond to the white, red, or reddish areas in the RGB image \
%[text] **You Try:**
%[text] - Change the above code to show the Green and Blue channels \
%%
%[text] Enter the syntax to index out channel 2 from RGB and assign to `imgpln`

%%
%[text] ### Display all channels using a FOR LOOP
%[text] We can use all of our MATLAB tricks to index out the channels and display them. And we'll throw in the RGB image to boot
figure;
tiledlayout(1,4,"TileSpacing","none","Padding","none")

chNames = ["red", "green","blue"]; % for the titles

% display RGB image outside loop
nexttile
imshow(RGB); title('RGB') % show the RGB image in position 1

for n=1:numel(chNames)
    nexttile
    imshow(RGB(:,:,n)) % notice that we index out the channel on each iteration of the loop
    title(chNames{n})
end
%[text] - Compare the channels to the RGB image
%[text] - Notice that the bright spots in a given channel somewhat correlate to the corresponding color in the RGB image
%[text] - Also notice that white in the RGB image is bright across all channels and black is dark across all channels \
%%
%[text] ### imsplit
%[text] The function **imsplit** can do the indexing for you and return  individual channels
[red,green,blue] = imsplit(RGB);

clf;
tiledlayout(1,3)
nexttile; imshow(red); title('red')
nexttile; imshow(green); title('green')
nexttile; imshow(blue); title('blue')
%%
%[text] You can even just grab one channel, using this syntax:
[~,~,blue] = imsplit(RGB);
clf;
imshow(blue);
title("Just the Blue channel")
%%
%[text] %[text:anchor:H_C07A7A18] ## Colormaps and Channels
%[text] Since channels are effectively grayscale images, you can display a channel with a colormap. 
figure(WindowStyle="docked")
%%
%[text] Here's the red channel with the HOT look-up table
clf
imshow(green, turbo(256)); 
title('Green Channel, Turbo Colormap')
colorbar
impixelinfo
%[text] - scrub around this image: only 1 pixel per site
%[text] - The channel still has the same intensity values, it has just be mapped to a different colormap \
%[text] **You try:**
%[text] - Change the colormap to hot
%[text] - Display the Blue Channel with the Parula Colormap \
%%
%[text] %[text:anchor:H_1E26A5B4] ### Red, green, and blue colormaps
%[text] Fancy imaging software typically display their channels colorized: i.e. The red channel is shown in shades of red, while the blue channel is shown in shades of blue. The way that they do this is by applying a colormap to each channel that matches the channel's color: e.g. Red, Green, and Blue colormaps
%[text] Unfortunately, MATLAB does not come with a RED or GREEN or BLUE colormap. But we can roll our own. The course function **`mmGetChannelMap`** gets a color map for an indicated channel. You can access the documentation as follows:
help mmGetChannelMap
%%
%[text] Here's how you use the function
red_map = mmGetChannelMap('red')
%[text] - notice that there are only values in the first column (and zeros everywhere else). These are shades of red \
%%
%[text] You can also input an channel number. 
%[text] %[text:anchor:H_BF14FE4A] Now, we can display our channel image colorized, as follows
clf
ch = 1; %[control:spinner:5c2f]{"position":[6,7]}
chs = ["Red","Green","Blue"]
imshow(RGB(:,:,ch), mmGetChannelMap(ch))
title(sprintf('%s Channel',chs(ch)))
colorbar
impixelinfo
%%
%[text] %[text:anchor:H_B81BF16B] ### You try
%[text] Create a FOR LOOP to display each channel in its colorized colormap

%[text] 
%%
%[text] %[text:anchor:T_048C0A08] # Histograms
%[text] %[text:anchor:H_B3622CAB] ## RGB and imhist
%[text] %[text:anchor:H_FB19804C] What happens when you display the histogram of an RGB image?
clf
imhist(RGB);
title('RGB histogram')
%[text] - You get the histogram for ALL the pixels, not sorted by channel.
%[text] - Many image processing software split the histogram by channel \
%%
%[text] %[text:anchor:H_BF9E81AD] ## mmHistColor
%[text] It is sometimes useful for RGB histograms to have three overlaid histograms: 1 for each channel.  **imhist** does not do this, so, I rolled my own. You can find it in the Course Functions folder and you can read its documentation using the following command. (Unfortunately, you can't search the documentation).
help mmHistColor
%%
figure;
tiledlayout(1,2,"TileSpacing","none","Padding","compact")
nexttile;
imshow(RGB);
title('RGB')

nexttile;
mmHistColor(RGB);
title('mmHistColor')
ylim([0 5e4]) % crop the histogram
%[text] - Notice that it is compatible with **nexttile** \
%%
%[text] %[text:anchor:H_D58F4368] ## mmShowHist
%[text] splits the channels and displays histograms for each channel
clf
mmShowHist(RGB)
%[text] 
%%
%[text] %[text:anchor:T_B17BB0BB] # Channel Swapping
%[text] %[text:anchor:T_F18B51DC] If we reorder the channels, we get some interesting results.
%[text] First create the three separate channel images again (just in case).
[red,green,blue] = imsplit(RGB);
%[text] %[text:anchor:H_E95AA61E] ## Swap the Channels
%[text] What happens when you swap the channels?
%%
%[text] For example: Let's create a Green, Red, Blue image using the function **cat**, which allows us to concatenate the planes across the third dimension
%[text] ![](text:image:1b59)![](text:image:7a79)
GRB = cat(3,green, red, blue); % reorder the planes
%[text] - now we just have a new image, \
%%
%[text] What does our new image looklike
figure;
tiledlayout(1,2,"TileSpacing","none","Padding","compact")
nexttile; imshow(RGB); title('RGB') % display original
nexttile; imshow(GRB); title('GRB') % display reordered image
%[text] - so, it is still an RGB true color image, but it looks kind of weird.
%[text] - This highlights the fact that the order of the planes is a critical component of how the color is actually generated \
%%
%[text] ### You Try: How about Blue, Green, Red?
%[text] %[text:anchor:H_9C8AEBAC] Well that was fun, let's try other combinations. How about BRG
%[text] ![](text:image:5abe)

%[text] - also weird looking \
%%
%[text] %[text:anchor:H_F155F76D] ## What happens if we don't include a channel?
%[text] Well, that wouldn't work. RGB images must have 3 channels. But, if you create a channel of zeros, then you can use that as one of the planes. 
%[text] The following code creates an RGB image with the red channel and two channels of zeros. 
chz = zeros(size(red),'like', red); % all vaules are zero
RZZ = cat(3, red, chz, chz);
%%
%[text] So, what does that look like? For comparison, we also plot the red channel with a red lookup table
close all
figure;
tiledlayout(1,2,"TileSpacing","none","Padding","none")

nexttile;
imshow(RZZ);
title('RZZ')

nexttile;
imshow(red, mmGetChannelMap('red'));
title('Red Channel with red LUT')
impixelinfo
%[text] ![](text:image:5a79)![](text:image:1fa8)
%[text] 
%[text] - The results look like the plot of a channel using the red colormap
%[text] -  However, the image is still an RGB image (because there are three planes)
%[text] - Compare to the gray with look up table. Scrub your mouse around the images. How are intensities reported in the RGB image? In the Gray with red LUT?.  \
%%
%[text] %[text:anchor:H_CF184F3C] ### RGZ
%[text] %[text:anchor:H_759C9DA2] What if we included the green channel as well? Or, to think of it another way, what if we set the blue channel to all zeros?
%[text] ![](text:image:43a7)
RGZ = cat(3, red, green, chz);

figure;
tiledlayout(1,2,"TileSpacing","none","Padding","tight");
nexttile; imshow(RGB); title('RGB')

nexttile; imshow(RGZ); title('RGZ')
%[text] - all of the blue information is now gone \
%%
%[text] %[text:anchor:H_76F9AFCB] ## What if we duplicated a channel?
%[text] - Here we use the same channel info for both the red and blue channels
%[text] - And we include a Zeros plane for the green channel \
RZR = cat(3, red, chz, red);

imshow(RZR)
title('RZR')
%[text] You get Magenta! Which, as we know, only exists in our minds. 
%%
%[text] %[text:anchor:H_FBCD5B14] ## Show the histogram of RZR
figure
mmHistColor(RZR,'stem')

xlim([1 255])
ylim([0 44721])
%[text] Notice that the blue and the red channels are identical (the stem plots for each channel are offset to improve visualization).
%[text]  The green channel is that green line running along the bottom of the plot (all zeros)
%%
